import React from 'react';
import './Header.css';

const Header = () => {
    return (
        <nav className='header'>
            <div>
                <a href="/home">HOME</a>
                <a href="/orders">Orders</a>
                <a href="/inventory">Inventory</a>
                <a href="/about">About</a>
            </div>
        </nav>
    );
};

export default Header;
